import {Route, BrowserRouter as Router, Routes, Link, BrowserRouter, Navigate, useLocation} from 'react-router-dom'
import Agendamento from './components/pages/agendconsul'
import Consultas from './components/pages/consultas'
import Container from './components/layout/Container';
import footer from './components/layout/Footer';
import Navbar from './components/layout/Navbar';
import Footer from './components/layout/Footer';
import DetalhesConsulta from './components/agendamentos/DetalhesConsulta';
import EditarConsulta from './components/agendamentos/EditarConsulta';
import Login from './components/pages/login'
import PrivateRoute from './components/PrivateRoute';




function AppRoutes() {
  const isAuth = localStorage.getItem('autenticado') === 'true';
  const location = useLocation();
  const isLoginPage = location.pathname === '/';

  return (

    <>



    {!isLoginPage && <Navbar />}



      <Routes>
            <Route path="/" element={<Login />} />
            <Route path="/agendamento" element={<PrivateRoute><Agendamento /></PrivateRoute>} />
            <Route path="/consultas" element={<PrivateRoute><Consultas /></PrivateRoute> }/>
            <Route path="/detalhes-consulta" element={<PrivateRoute><DetalhesConsulta />
            </PrivateRoute>} />
            <Route path="/editar-consulta" element={<PrivateRoute><EditarConsulta /></PrivateRoute>} />

    </Routes> 
   <Footer/>



   </>


  );
}

export default AppRoutes;
